	if(records[i].type == "A" && records[i].domain == workflow.scratchpad.domain_name ){
		workflow.scratchpad.a_record = records[i].id;
	}
	if(records[i].type == "AAAA" && records[i].domain == workflow.scratchpad.domain_name ){
		workflow.scratchpad.aaaa_record = records[i].id;
	}
}

