var options = data.get(3).output.options;

for (var i=0; i< options.length; i++) {
	if(options[i].name == "dhcpv4/domain-name"){
		if(options[i].value != ""){
			workflow.scratchpad.domain_name = options[i].value;
		}
	}
	if(options[i].name == "dhcpv4/host-name"){
		if(options[i].value != ""){
			workflow.scratchpad.host_name = options[i].value;
		}
	}
}

workflow.scratchpad.address_id = data.get(3).output.address_id;

